import React, {Component} from "react";
import './MiddleContainer.css';
import img from './middle_my_pic3.jpg';

class MiddleContainer extends Component {
    render() {
        return(
            <div className="middle-contain">
                <img src={img} alt="my_pic" className="my_pic3"/>
                <div className="itsme">
                <p className="hey">Hi, I'm <b>Sahil</b></p>
                <p className="dev">I'm a <b>react website developer</b></p></div>
                <div className="ending-front-page">
                    <div className="quote">
                <p className="animp">Willing to create websites that inspires.</p></div>
                <button className="front-contact-btn">Contact Us</button>
                </div>
                </div>
        );
    }
}

export default MiddleContainer;
